import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Route,
    Switch
} from 'react-router-dom';
import Body from '../Components/Body';
import Login from '../Components/Login';
import Register from '../Components/Register';

class DirectionURL extends Component {
    constructor(props) {
        super(props);
        this.state = {
            login: true,
        }
    }

    notLogin = () => {
        return (
            <Switch>
                <Route path="/login">
                    <Login />
                </Route>
                <Route path="/register">
                    <Register />
                </Route>
                <Route path="/">
                    <Login />
                </Route>
            </Switch>
        )
    }

    Login = () => {
        return (
            <Switch>
                <Route path="/body">
                    <Body />
                </Route>
                <Route path="/">
                    <Body />
                </Route>
            </Switch>
        )
    }

    render() {
        return (
            <div>
                {this.Login}
            </div>
        );
    }
}

export default DirectionURL;
